// Количество юнитов на страницу
let pageSize = 9;
// Интервал запроса онлайн-данных с сервера, в миллисекундах
let timerInterval = 1000;

// Начальная позиция карты (центрирование на Санкт-Петербурге)
let initialMapPosition = [51.819879855767255, 107.60937851186925];
// Начальный масштаб
let initialMapZoom = 12;
//  Это иконка машинки, которая будет рисоваться на карте
//  iconUrl может быть как ссылкой на картинку, так и самой картинкой,
// закодированной в Base64 с помощью специального конвертера (можно найти в интернете)
let markerIcon = L.icon({
    iconUrl: 'data:image/png;base64,\n',
    iconSize: [52, 52], // размер иконки
    iconAnchor: [26, 52], // координаты якоря иконки (точка, координаты которой укзываются для прикрепления иконки к карте)
});

// Адрес СПИК
// let baseUrl = 'http://platform.scout-gps.ru:8081/spic/';
let baseUrl = 'http://login.scout-gps.ru:8081/spic/'

// Адрес метода входа в систему
let loginUrl = baseUrl + 'auth/rest/Login';

// Адрес метода получения количества юнитов
let getAllUnitsCountUrl = baseUrl + 'units/rest/';
// Адрес метода получения страницы юнитов
let getAllUnitsPagedUrl = baseUrl + 'units/rest/getAllUnitsPaged';

// Адрес метода создания подписки на получение онлайн-данных
let subscribeUrl = baseUrl + 'OnlineDataService/rest/Subscribe';
// Адрес метода получения онлайн-данных по идентификатору подписки
let getOnlineDataUrl = baseUrl + 'OnlineDataService/rest/GetOnlineData';

// Объект класса, упрощающего отправку запросов на сервер и получение ответа
let requestProvider = new HttpJsonRequestProvider();

// Токен авторизации. Вставляется в header исходящих запросов на сервер.
// Выдается при входе в систему
let authorizationToken;
// Идентификатор подписки на получение онлайн-данных
let onlineDataSubscriptionId;
// Массив юнитов
let allUnits = [];
// Текущая страница юнитов
let currentUnitsPage = [];
// Словарь юнитов. Ключ - идентификатор юнита
let allUnitsDictionary = [];
// Словарь онлайн-данных юнитов. Ключ - идентификатор юнита.
let onlineDataDictionary = [];
// Словарь маркеров (объекты на карте). Ключ - идентификатор юнита.
let markersDictionary = [];
// Объект карты leaflet.
let map;
// Handler таймера (указатель на него), обновляющего онлайн-данные
let onlineDataUpdater;

//  Метод, вызываемый при входе в систему.
//  После нажатия кнопки "Войти" проверяются логин и пароль. Если вход
// разрешен, то запоминаем токен авторизации скрываем форму входа, загружаем все
// юниты, запускаем таймер для загрузки онлайн-данных, загружаем 0ю страницу
// списка юнитов
function login() {
    let login = "garmayev@yandex.ru";
    let pass = "12345";

    let request = {
        Login: login,
        Password: pass,
        TimeStampUtc: '/Date(' + new Date().getTime() + ')/',
        TimeZoneOlsonId: 'Europe/Moscow',
        CultureName: 'ru-ru',
        UiCultureName: 'ru-ru'
    };

    // Вход в систему
    let loginResponse = requestProvider.POST(loginUrl, request).response;
    if (!loginResponse || !loginResponse.SessionId) {
        alert("Login failed");
        return;
    }
    authorizationToken = loginResponse.SessionId;
    // document.getElementById('loginDiv').style.display = 'none';

    // Запрос всех юнитов
    let unitsCount = requestProvider.GETAuthorized(getAllUnitsCountUrl, null, authorizationToken).response;
    allUnits = getPageOfUnits(0, unitsCount);
    allUnitsDictionary = getUnitsDictionary(allUnits);

    // Инициализация интерфейса
    generateAndSetContentOfPagesDiv(unitsCount);
    loadPage(0);
    initMap();

    // Запуск обновления онлайн-данных
    onlineDataUpdater = window.setInterval(timerCallback, timerInterval);

    // Метод, создающий словарь юнитов из массива (ключ - UnitId).
    function getUnitsDictionary(units) {
        let unitsDictionary = [];
        for (let i in units) {
            let unit = units[i];
            unitsDictionary[unit.UnitId] = unit;
        }
        return unitsDictionary;
    }

    // Метод, заполняющий список страниц в интерфейсе
    function generateAndSetContentOfPagesDiv(unitsCount) {
        let htmlCode = "";
        for (let i = 0; i < unitsCount/pageSize; i++) {
            htmlCode += generatePageButtonHtmlText(i);
        }
        console.log(htmlCode);
        // document.getElementById('pagesDiv').innerHTML = htmlCode;
    }

    // Метод, генерирующий html-код для кнопки перехода на определенную страницу юнитов.
    function generatePageButtonHtmlText(number) {
        return '<input type="button" value="' + number + '" onclick="loadPage(' + number + ')" />';
    }

    // Метод, инициализирующий карту. К началу его исполнения
    // на странице уже должен быть контейнер для карты
    function initMap() {
        // Создание карты
        // map = L.map('mapPlaceHolder').setView(initialMapPosition, initialMapZoom);
        map = ymaps.Map('map', initialMapPosition, initialMapZoom);

        // Так устанавливается провайдер тайлов:
        // L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
        //     attribution: 'Map data &copy; <a href="http://openstreetmap.org">OpenStreetMap</a> contributors, <a href="http://creativecommons.org/licenses/by-sa/2.0/">CC-BY-SA</a>',
        //     maxZoom: 18
        // }).addTo(map);
    }

    //  Здесь происходит обновление онлайн-данных (т.е. запрос с сервера и обновление
    // интерфейса пользователя).
    function timerCallback() {
        loadOnlineData();
        fillUnitsPage(currentUnitsPage);
    }
}

// Метод, заполняющий страницу юнитов в интерфейсе
function fillUnitsPage(units) {
    let htmlCode = "";
    for (let i = 0; i < units.length; i++) {
        htmlCode += generateUnitRowHtmlText(units[i], onlineDataDictionary[units[i].UnitId]);
    }
    // document.getElementById('unitsTableBody').innerHTML = htmlCode;

    // Метод генерирует html-код для строки таблицы, в которой будут данные о юните.
    function generateUnitRowHtmlText(unit, onlineData) {

        return '<tr onclick="centerMap(' + unit.UnitId + ')"><td>' +
            unit.Name +
            '</td><td>' +
            (onlineData && onlineData.Navigation && onlineData.Navigation.Speed ? onlineData.Navigation.Speed : 0) +
            '</td><td>' +
            (onlineData ? onlineData.Address : "") +
            '</td></tr>';
    }
    // console.log(htmlCode);
}

//  Метод, загружающий страницу юнитов. number - номер страницы
//  Здесь с сервера загружается страница юнитов (на самом деле целесообразнее
// разбивать на страницы уже подгруженные юниты, но в рамках этой задачи сделано таким образом)
function loadPage(number) {
    currentUnitsPage = getPageOfUnits(number * pageSize, pageSize);

    fillUnitsPage(currentUnitsPage);
}

// Метод, центрирующий карту на юните с указанным идентификатором
function centerMap(unitId) {
    if (!markersDictionary[unitId]) return;
    let latlng = markersDictionary[unitId].getLatLng();
    map.panTo(latlng);
}

// Метод, запрашивающий страницу юнитов с сервера.
function getPageOfUnits(offset, count) {
    return requestProvider.POSTAuthorized(getAllUnitsPagedUrl,
        {
            Offset: offset,
            Count: count
        },
        authorizationToken).response.Units;
}

//  Метод, загружающий онлайн-данные с сервера. При первом вызове метода,
// производится подписка на получение онлайн-данных.
function loadOnlineData() {

    if (!onlineDataSubscriptionId) {
        // Подписка на онлайн данные (если это первый вызов метода)
        onlineDataSubscriptionId = subscribeOnlineData(allUnits);
    }
    let onlineDataCollection = getRawOnlineData(onlineDataSubscriptionId);
    console.log(onlineDataCollection);
    onlineDataDictionary = getOnlineDataDictionary(onlineDataCollection);
    addOrUpdateMarkers();

    // Подписка на получение онлайн-данных
    function subscribeOnlineData(units) {
        let typeIdOnlineData = "ea8ac3c9-bb3c-42fe-a8a0-1373d05c071c";
        let typeIdUnit = "0f1e3a4a-88f5-4166-9be8-76033dd85d08";

        let objectIdentities = [];
        for (let i = 0; i < units.length; i++) {
            objectIdentities.push(units[i].UnitId);
        }

        return requestProvider.POSTAuthorized(subscribeUrl,
            {
                //EventTypeId: typeIdOnlineData,
                UnitIds: objectIdentities
            },
            authorizationToken).response.SessionId;
    }

    // Запрос "сырых" онлайн-данных с сервера
    function getRawOnlineData(subscriptionId) {
        return requestProvider.POSTAuthorized(getOnlineDataUrl,
            subscriptionId,
            authorizationToken).response.OnlineDataCollection;
    }

    //  Преобразование онлайн-данных в более удобный вид.
    // В данном случае - это словарь онлайн-данных. Ключ - идентификатор юнита.
    function getOnlineDataDictionary(onlineDataCollection) {
        let odd = [];
        for (let i = 0; i < onlineDataCollection.DataCollection.length; i++) {
            odd[onlineDataCollection.Targets[i]] = onlineDataCollection.DataCollection[i];
        }
        return odd;
    }

    // Метод, добавляющий или обновляющий маркеры на карте.
    function addOrUpdateMarkers() {
        for (let unitId in onlineDataDictionary) {
            let onlineData = onlineDataDictionary[unitId];
            if (!onlineData || !onlineData.Navigation || !onlineData.Navigation.Location) continue;
            let lon = onlineData.Navigation.Location.Longitude;
            let lat = onlineData.Navigation.Location.Latitude;

            if (unitId in markersDictionary) {
                markersDictionary[unitId].setLatLng([lat, lon]);
                markersDictionary[unitId].update();
            } else {
                markersDictionary[unitId] = L.marker([lat, lon], { icon: markerIcon, title: allUnitsDictionary[unitId].Name }).addTo(map);
            }
        }
    }
}

// Это класс, упрощающий отправку запросов на сервер и получение ответа.
function HttpJsonRequestProvider() {

    let xmlhttp = new XMLHttpRequest();

    // url - ссылка на ресурс
    // sendData - данные для отправки
    // method - метод запроса ('GET', 'POST', 'PUT'...)
    //   Если method не был задан, то будет выполнен POST-запрос.
    // Поле url - обязательное.
    // Метод sendRequest возвращает результат запроса {status, response}.
    let sendRequest = function (url, sendData, method, authorizationToken) {
        if (!url)
            throw new Error('Url required.');
        //если метод не передан, то подразумевается POST
        method = method || "POST";
        //если sendData не строка, то делаем из нее или пустого объекта строку
        if (!(typeof sendData == 'string' || sendData instanceof String)) {
            sendData = JSON.stringify(sendData || {});
        }

        //создаем соединение
        xmlhttp.open(method, url, false);
        //задаем header
        xmlhttp.setRequestHeader("Accept", "json");
        xmlhttp.setRequestHeader("Content-Type", "application/json");
        //если приложен authorizationToken
        if (authorizationToken) {
            xmlhttp.setRequestHeader("ScoutAuthorization", authorizationToken);
        }
        //отправляем
        xmlhttp.send(sendData);

        //возвращаем статус и тело ответа
        let responseText = xmlhttp.responseText;
        if (responseText) {
            try {
                responseText = JSON.parse(responseText);
            } catch (e) {
                alert("Incorrect JSON response from server");
            }
        }
        return {
            status: xmlhttp.status,
            response: responseText
        };
    };

    this.GET = function (url, sendData) {
        return sendRequest(url, sendData, 'GET');
    };

    this.POST = function (url, sendData) {
        return sendRequest(url, sendData, 'POST');
    };

    this.GETAuthorized = function (url, sendData, authorizationToken) {
        return sendRequest(url, sendData, 'GET', authorizationToken);
    };

    this.POSTAuthorized = function (url, sendData, authorizationToken) {
        return sendRequest(url, sendData, 'POST', authorizationToken);
    };
}

document.addEventListener("DOMContentLoaded", () => {
    login();
})